DROP TABLE IF EXISTS `aff_car_info`;
CREATE TABLE `aff_car_info`  (
  `c_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '表主键',
  `car_model` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '车型号',
  `car_card` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '车牌号',
  `car_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '车种类',
  `car_limit` int(255) NULL DEFAULT NULL COMMENT '限乘人数',
  `buy_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '购买时间',
  `kilometres` int(255) NULL DEFAULT NULL COMMENT '行驶里程',
  `next_inspection_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '下次年检时间',
  `car_status` int(255) NULL DEFAULT NULL COMMENT '车辆状态0使用中1可使用2维修中',
  PRIMARY KEY (`c_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

