  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '资产目录表主键',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '目录名称',
  `createtime` date NULL DEFAULT NULL COMMENT '创建时间',
  `creator` int(255) NULL DEFAULT NULL COMMENT '创建人主键，和用户表外联',
  `update_user` int(255) NULL DEFAULT NULL COMMENT '修改人id，和用户表关联查询',
  `updatetime` date NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

