INSERT INTO `aff_t_notice` VALUES (1, 1, '关于“绿色发展背景下的我国碳排放权交易会计准则的研究和制定”征询意向公告', '经财政部批准，会计准则委员会正在执行世界银行贷款“现代财政制度与国家治理”技援项目中的一个子项目“绿色发展背景下的我国碳排放权交易会计准则”。该子项目的目标是，在贯彻新发展理念、加快绿色发展背景下，以2017年12月19日全国碳市场启动为契机，基于会计准则委员会2016年9月发布的《碳排放权交易试点有关会计处理暂行规定（征求意见稿）》中尚存争议的核心问题，从碳排放权交易机制的运行机理出发，分析国际碳排放权交易会计处理方法，为制定中国碳会计准则提供理论和实践研究成果，从而为碳交易市场、碳金融市场的发展提供制度保障，更好地激发企业节能减排潜力，推动绿色低碳转型升级。为此，会计准则委员会希望聘请咨询机构，就“绿色发展背景下的我国碳排放权交易会计准则的研究和制定”开展研究。此任务的主要内容如下：经财政部批准，会计准则委员会正在执行世界银行贷款“现代财政制度与国家治理”技援项目中的一个子项目“绿色发展背景下的我国碳排放权交易会计准则”。该子项目的目标是，在贯彻新发展理念、加快绿色发展背景下，以2017年12月19日全国碳市场启动为契机，基于会计准则委员会2016年9月发布的《碳排放权交易试点有关会计处理暂行规定（征求意见稿）》中尚存争议的核心问题，从碳排放权交易机制的运行机理出发，分析国际碳排放权交易会计处理方法，为制定中国碳会计准则提供理论和实践研究成果，从而为碳交易市场、碳金融市场的发展提供制度保障，更好地激发企业节能减排潜力，推动绿色低碳转型升级。为此，会计准则委员会希望聘请咨询机构，就“绿色发展背景下的我国碳排放权交易会计准则的研究和制定”开展研究。', '2019-02-26', 1);

